import { Component } from 'react';
import './App.css';

// COMPONENT
class App extends Component{
  constructor(){
    super();
    this.state={
      monsters: [
      {name:'Ruben',
      id: 'a5sa5s4f5as4a'},
      {name:'Pablo',
      id: '56ad4fa53s4f6'},
      {name: 'Gaspar',
      id: 'a56d4f3a43a2s'},
      {name: 'Geli',
      id: 'a2sf32af23as1'}
      ]
  }
}
  render (){
    return(
      //-----------------------------------
        <div className="App">
          {
            this.state.monsters.map((monster)=>{
              return <div key={monster.id}>{monster.name}</div>
            })
          }
        </div>        
      //-----------------------------------
    );
  }
}

export default App
